import React from 'react';
import { Box, SimpleGrid } from '@chakra-ui/react';
import tt from '../images/tt.svg';
import webapps from '../images/webapps.svg';
import gradeit from '../images/gradeit.svg';
import maps from '../images/maps.svg';
import insurance from '../images/insurance.svg';

const Projects = props => {
  return (
    <Box {...props} h="auto" pb="20" w="100%">
      <Header description="case studies" title="Projects" />
      <Box
        display="flex"
        flexDirection="column"
        justifyContent="center"
        alignItems="center"
      >
        <SimpleGrid
          justifyContent="center"
          alignItems="center"
          columns={{ sm: 1, md: 2 }}
          px="20"
          pt="10"
          maxW="100%"
          mx="auto"
        >
          <Card
            mr={20}
            mb={20}
            name="Code.it"
            description="HighSchool Education Platform"
            start="2020"
            end="Present"
            image={tt}
            size="4xl"
            height={500}
            descriptionSize="lg"
          />

          <Card
            mr={20}
            mb={20}
            name="Nifty Web Apps"
            description="Build web apps for any programming assignment"
            start="2020"
            end="Present"
            image={webapps}
            size="4xl"
            height={500}
            descriptionSize="lg"
          />
        </SimpleGrid>

        <SimpleGrid columns={{ sm: 1, md: 3 }} px="20" maxW="100%">
          <Card
            mr={5}
            mb={10}
            name="Java Code Quality Linter"
            description="Web/Text Checker"
            start="2020"
            end="Present"
            image={insurance}
            size="2xl"
            height={500}
            descriptionSize="md"
          />

          <Card
            ml={5}
            mr={5}
            mb={10}
            name="Course Data Migration"
            description="Writing jUnit tests"
            start="2020"
            end="Present"
            image={gradeit}
            size="2xl"
            height={500}
            descriptionSize="md"
          />

          <Card
            ml={5}
            mr={5}
            mb={10}
            name="Husky Maps"
            description="Interactive Map Viz"
            start="2019"
            end="2020"
            image={maps}
            size="2xl"
            height={500}
            descriptionSize="md"
          />
        </SimpleGrid>
      </Box>
    </Box>
  );
};

export default Projects;
